function App() {
  return( 
    <header>   
    <Link to="/">Home</Link> 
    <Link to="/About">About</Link>
    <BrowserRouter>
    <Routes>
        <Route path="/" component={Home}/>
        <Route path='/About' component={About}/>
    </Routes>
    </BrowserRouter>
    </header>
);
}

export default App;
